import React from 'react';

const Images = () => {

    const baseUrl = 'http://127.0.0.1:5000/analyze-mosquitoes'
    const [imageNumber, setImageNumber] = React.useState(null)

    const imageList = [1, 2, 3, 4, 5];

    const containerStyle = {
        display: 'flex',
        flexDirection: 'row',  // Align items horizontally
        gap: '20px',           // Add space between child elements
    };

    const sidebarStyle = {
        width: '200px',        // Set sidebar width
        backgroundColor: '#f0f0f0',
        padding: '10px',
    };

    const buttonsContainerStyle = {
        display: 'flex',
        gap: '10px',
        marginLeft: '20px',    // Add margin between sidebar and buttons
    };

    const buttonStyle = {
        backgroundColor: '#E1F4F3',
        padding: '10px',
        borderRadius: '5px',
        cursor: 'pointer',
    };

    return (
        <div style={containerStyle}>
            <div style={sidebarStyle}>
                {/* Your sidebar content here */}
                Sidebar content
            </div>
            <div style={buttonsContainerStyle}>
                {imageList?.map((item) => (
                    <div style={buttonStyle} key={item}
                        onClick={() => setImageNumber(item)}
                    >
                        Sample {item}
                    </div>
                ))}
            </div>
            <div className='flex justify-center items-center'>
                {imageNumber && <img src={`${baseUrl}/${imageNumber}`} width={500} height={250} />}
            </div>
        </div>
    );
};

export default Images;
